import React from 'react';
import "./Share.css";

export default function Share() {
	return (
	<div className='share'>
		<div className="shareWrapper">
			<div className="shareTop">
				<img src="/assets/person/1.p" alt="" />
			</div>
			<div className="shareButtons"></div>
		</div>
	</div>
	);
}
